import { Link } from "react-router-dom";
import "./Item.css"
const Item = ({ title, image, descripcion, price }) => {
    return (
    <>
    <div>
        <h1>{title}</h1><br />
        <img className="imagenes" src={image} alt="" /><br />
        <h4>{descripcion}</h4>
        <h2>${price}</h2><br /><br />
    </div>
    <Link to={"/item/"}>Ver Detalle</Link>
    </>
    );
};
  export default Item;
